angular.module("application.templates",[]).run(["$templateCache",function(n){n.put("dashboard_menu.html",'<md-list flex ng-controller="DashboardMenuController">\r\n    <md-list-item ng-click="dashboard()">\r\n        <md-icon style="color: blue">dashboard</md-icon>\r\n        <p>{{ \'title_dashboard\' | translate }}</p>\r\n    </md-list-item>\r\n    <md-list-item ng-click="charts()">\r\n        <md-icon style="color: blue">insert_chart</md-icon>\r\n        <p>{{ \'title_insert_chart\' | translate }}</p>\r\n    </md-list-item>\r\n    <md-list-item ng-click="tables()">\r\n        <md-icon style="color: blue">web</md-icon>\r\n        <p>{{ \'title_table\' | translate }}</p>\r\n    </md-list-item>\r\n    <md-list-item ng-click="forms()">\r\n        <md-icon style="color: blue">edit</md-icon>\r\n        <p>{{ \'title_form\' | translate }}</p>\r\n    </md-list-item>\r\n    <md-list-item ng-click="uiElement()">\r\n        <md-icon style="color: blue">build</md-icon>\r\n        <p>{{ \'title_ui_element\' | translate }}</p>\r\n    </md-list-item>\r\n    <md-list-item ng-click="dropDown()">\r\n        <md-icon style="color: blue">arrow_drop_down_circle</md-icon>\r\n        <p>{{ \'title_drop_down\' | translate }}</p>\r\n    </md-list-item>\r\n    <md-list-item ng-click="samplePages()">\r\n        <md-icon style="color: blue">content_copy</md-icon>\r\n        <p>{{ \'title_sample_pages\' | translate }}</p>\r\n    </md-list-item>\r\n</md-list>'),n.put("dashboard/dashboard.html",'<md-content flex layout="row" md-swipe-left="close()" md-swipe-right="menu()" md-theme="{{theme}}">\r\n    <md-sidenav class="md-sidenav-left md-whiteframe-z2" md-component-id="menu" md-is-locked-open="$mdMedia(\'gt-md\')">\r\n        <md-toolbar class="app-toolbar md-whiteframe-z2" ng-animate="animate" md-component-id="&quot;menu">\r\n            <div class="md-toolbar-tools">\r\n            {{ \'title_menu\' | translate }}\r\n            </div>\r\n        </md-toolbar>\r\n        <ng-include src="\'dashboard_menu.html\'"></ng-include>\r\n    </md-sidenav>    \r\n    \r\n    <md-content flex layout="column">\r\n        <md-toolbar class="md-whiteframe-z2" md-scroll-shrink>\r\n            <div class="md-toolbar-tools" ng-if="theme == \'teal\'">\r\n                <md-button class="md-icon-button" hide-gt-md ng-click="menu()">\r\n                    <md-tooltip>{{ \'action_menu\' | translate }}</md-tooltip>\r\n                    <md-icon>menu</md-icon>\r\n                </md-button>\r\n                <h2 class="md-title">{{ \'title_table\' | translate }}</h2>\r\n                <span flex></span>\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'white\'">\r\n                    <md-tooltip>{{ \'action_email\' | translate }}</md-tooltip>\r\n                    <md-icon>email</md-icon>\r\n                </md-button>\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'white\'">\r\n                    <md-tooltip>{{ \'action_notifications\' | translate }}</md-tooltip>\r\n                    <md-icon>notifications</md-icon>\r\n                </md-button>\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'white\'">\r\n                    <md-tooltip>{{ \'action_search\' | translate }}</md-tooltip>\r\n                    <md-icon>search</md-icon>\r\n                </md-button>\r\n            </div>\r\n\r\n            <div class="md-toolbar-tools" ng-if="theme == \'white\'">\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'teal\'">\r\n                    <md-tooltip>{{ \'action_back\' | translate }}</md-tooltip>\r\n                    <md-icon>arrow_back</md-icon>\r\n                </md-button>\r\n                <md-input-container flex md-no-float>\r\n                    <br>\r\n                    <input ng-model="$parent.query.$" placeholder="{{ \'action_search\' | translate }}" type="search">\r\n                </md-input-container>\r\n                <md-button class="md-icon-button" ng-click="reset()">\r\n                    <md-tooltip>{{ \'action_reset\' | translate }}</md-tooltip>\r\n                    <md-icon>cancel</md-icon>\r\n                </md-button>\r\n            </div>\r\n        </md-toolbar>\r\n        \r\n            <div ng-controller="DashboardController as vm" md-theme="light-green" layout-margin style="padding:25px">\r\n            \r\n            <div layout="row" layout-margin>\r\n              <div class="panel-heading" flex flex-order="4">\r\n                <md-tooltip>{{ \'action_comment\' | translate }}</md-tooltip>\r\n                    <md-icon>comment</md-icon>\r\n                    New Comments\r\n              </div>\r\n              <div class="panel-heading" flex flex-order="3">\r\n                <md-tooltip>{{ \'action_person\' | translate }}</md-tooltip>\r\n                    <md-icon>person</md-icon>\r\n                    New Task\r\n              </div>\r\n              <div class="panel-heading" flex flex-order="2">\r\n                <md-tooltip>{{ \'action_shopping_cart\' | translate }}</md-tooltip>\r\n                    <md-icon>shopping_cart</md-icon>\r\n                    New Order\r\n              </div>\r\n              <div class="panel-heading" flex flex-order="1">\r\n                <md-tooltip>{{ \'action_details\' | translate }}</md-tooltip>\r\n                    <md-icon>details</md-icon>\r\n                    Details\r\n              </div>\r\n            </div>\r\n            \r\n              <h2 class="md-title">Determinate</h2>\r\n              <p>\r\n                For operations where the percentage of the operation completed can be determined, use a <b>determinate</b>\r\n                indicator.\r\n                They give users a quick sense of how long an operation will take.\r\n              </p>\r\n              <md-progress-linear md-mode="determinate" value="{{vm.determinateValue}}"></md-progress-linear>\r\n              <h4 class="md-title">Indeterminate</h4>\r\n              <p>\r\n                For operations where the user is asked to wait a moment while something finishes up, and it\'s not\r\n                necessary to expose what\'s happening behind the scenes and how long it will take, use an\r\n                <b>indeterminate</b> indicator:\r\n              </p>\r\n              <md-progress-linear md-mode="indeterminate" md-theme="{{thema}}"></md-progress-linear>\r\n              <h4 class="md-title">Buffer</h4>\r\n              <p>\r\n                For operations where the user wants to indicate some activity or loading from the server,\r\n                use the <b>buffer</b> indicator:\r\n              </p>\r\n              <md-progress-linear class="md-warn" md-mode="{{vm.modes[0]}}" value="{{vm.determinateValue}}" md-buffer-value="{{vm.determinateValue2}}"></md-progress-linear>\r\n              <h4 class="md-title">Query</h4>\r\n              <p>\r\n                For situations where the user wants to indicate pre-loading (until the loading can actually be made),\r\n                use the <b>query</b> indicator:\r\n              </p>\r\n              <div class="container" ng-class="{\'visible\' : !vm.activated}">\r\n                <md-progress-linear md-mode="{{vm.modes[1]}}" md-theme="pink"></md-progress-linear>\r\n                <div class="bottom-block">\r\n                  <span>Loading application libraries...</span>\r\n                </div>\r\n              </div>\r\n              <hr ng-class="{\'visible\' : vm.activated}">\r\n              <div layout="row" id="loaders">\r\n                <p>Query and Buffer progress linear indicators: </p>\r\n                <h5>Off</h5>\r\n                <md-switch ng-model="vm.activated" ng-change="vm.toggleActivation()" aria-label="Enable Indicators">\r\n                  <h5>On</h5>\r\n                </md-switch>\r\n              </div>\r\n              <p class="small">\r\n                Note: With the above switch -- which simply clears the md-mode in each <code>&lt;md-progress-linear\r\n                md-mode=""&gt;</code> element --\r\n                developers now easily disable the animations and hide their progress indicators.</p>\r\n            </div>         \r\n    </md-content>\r\n</md-content>')}]);